ospam@ez.no\"/></authors></ezauthor>\n','ezauthor',260,'eng-GB',2,0,'',1),(0,190,65,0,0,'','ezdatetime',261,'eng-GB',2,0,'',1),(0,191,65,0,0,'','ezsrrating',262,'eng-GB',2,0,'',1),(0,192,65,0,NULL,'','ezkeyword',263,'eng-GB',2,0,'',1),(0,4,66,0,NULL,'Selected Features','ezstring',264,'eng-GB',3,0,'selected features',1),(0,155,66,0,NULL,'','ezstring',265,'eng-GB',3,0,'',1),(0,119,66,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>','ezxmltext',266,'eng-GB',3,0,'',1),(0,156,66,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>','ezxmltext',267,'eng-GB',3,0,'',1),(268,158,66,0,1,'','ezboolean',268,'eng-GB',3,1,'',1),(0,181,67,0,NULL,'Automate','ezstring',269,'eng-GB',2,0,'automate',1),(0,182,67,0,NULL,'','ezstring',270,'eng-GB',2,0,'',1),(0,183,67,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>If Create, Deliver and Optimize is the winning formula, the last thing you want to do when you are there is to automate so that your online user experience is self-building!</paragraph></section>','ezxmltext',271,'eng-GB',2,0,'',1),(0,184,67,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Identifying the right content, picking delivery strategy, understanding your metrics and optimizing your online presence to have your numbers on the up-side are tasks that requires a lot of work that no machine could do by itself. However, when you have identified the right recipes in that Create - Deliver - Optimize cycle, the next thing you want to do is automate as much as possible all the recurring tasks. That is where a platform like the eZ Publish Platform will deliver even more value, from Content sourcing and authoring to delivery workflow and marketing automation, relying on an integrated platform will help you automate the tasks that are taking your KPIs and your online business up!</paragraph></section>','ezxmltext',272,'eng-GB',2,0,'',1),(0,185,67,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>','ezxmltext',273,'eng-GB',2,0,'',1),(0,186,67,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Automate.jpg\" suffix=\"jpg\" basename=\"Automate\" dirpath=\"var/ezdemo_site/storage/images/getting-started/selected-features/automate/274-1-eng-GB\" url=\"var/ezdemo_site/storage/images/getting-started/selected-features/automate/274-1-eng-GB/Automate.jpg\" original_filename=\"ba2a2bea.jpg\" mime_type=\"image/jpeg\" width=\"770\" height=\"281\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236425\"><original attribute_id=\"274\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"281\" Width=\"770\" IsColor=\"1\" ByteOrderMotorola=\"1\" Thumbnail.FileType=\"2\" Thumbnail.MimeType=\"image/jpeg\"><array name=\"ifd0\"><item key=\"Orientation\" base64=\"1\">MQ==</item><item key=\"XResolution\" base64=\"1\">NzIwMDAwLzEwMDAw</item><item key=\"YResolution\" base64=\"1\">NzIwMDAwLzEwMDAw</item><item key=\"ResolutionUnit\" base64=\"1\">Mg==</item><item key=\"Software\" base64=\"1\">QWRvYmUgUGhvdG9zaG9wIENTNiAoTWFjaW50b3NoKQ==</item><item key=\"DateTime\" base64=\"1\">MjAxNDoxMToxMCAxNzo0MjoyMA==</item><item key=\"Exif_IFD_Pointer\" base64=\"1\">MTY4</item></array><array name=\"exif\"><item key=\"ColorSpace\" base64=\"1\">MQ==</item><item key=\"ExifImageWidth\" base64=\"1\">Nzcw</item><item key=\"ExifImageLength\" base64=\"1\">Mjgx</item></array></information></ezimage>\n','ezimage',274,'eng-GB',2,0,'',1),(0,187,67,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>','ezxmltext',275,'eng-GB',2,0,'',1),(0,188,67,0,1,'','ezgmaplocation',276,'eng-GB',2,0,'Castor, Italy',1),(0,189,67,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezauthor><authors><author id=\"0\" name=\"Administrator User\" email=\"nospam@ez.no\"/></authors></ezauthor>\n','ezauthor',277,'eng-GB',2,0,'',1),(0,190,67,0,0,'','ezdatetime',278,'eng-GB',2,0,'',1),(0,191,67,0,0,'','ezsrrating',279,'eng-GB',2,0,'',1),(0,192,67,0,NULL,'','ezkeyword',280,'eng-GB',2,0,'',1),(0,181,68,0,NULL,'Deliver','ezstring',281,'eng-GB',2,0,'deliver',1),(0,182,68,0,NULL,'','ezstring',282,'eng-GB',2,0,'',1),(0,183,68,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Content consumption is changing rapidly. An agile solution to distribute your content and empower your digital business model is key to success in every industry.</paragraph></section>','ezxmltext',283,'eng-GB',2,0,'',1),(0,184,68,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>eZ Publish Enterprise is the platform to make the omni-channel approach possible. A powerful presentation engine provides a multiplicity of websites and pages that display your content in a variety of renderings. A powerful API directly and simply integrates your content with any Web-enabled application on any device, including the iPad, iPhone or Android without ever interfering with or impacting the platform itself.</paragraph></section>','ezxmltext',284,'eng-GB',2,0,'',1),(0,185,68,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>','ezxmltext',285,'eng-GB',2,0,'',1),(0,186,68,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Deliver.jpg\" suffix=\"jpg\" basename=\"Deliver\" dirpath=\"var/ezdemo_site/storage/images/getting-started/selected-features/deliver/286-1-eng-GB\" url=\"var/ezdemo_site/storage/images/getting-started/selected-features/deliver/286-1-eng-GB/Deliver.jpg\" original_filename=\"c97d7955.jpg\" mime_type=\"image/jpeg\" width=\"770\" height=\"281\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236425\"><original attribute_id=\"286\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"281\" Width=\"770\" IsColor=\"1\" ByteOrderMotorola=\"1\" Thumbnail.FileType=\"2\" Thumbnail.MimeType=\"image/jpeg\"><array name=\"ifd0\"><item key=\"Orientation\" base64=\"1\">MQ==</item><item key=\"XResolution\" base64=\"1\">NzIwMDAwLzEwMDAw</item><item key=\"YResolution\" base64=\"1\">NzIwMDAwLzEwMDAw</item><item key=\"ResolutionUnit\" base64=\"1\">Mg==</item><item key=\"Software\" base64=\"1\">QWRvYmUgUGhvdG9zaG9wIENTNiAoTWFjaW50b3NoKQ==</item><item key=\"DateTime\" base64=\"1\">MjAxNDoxMToxMCAxNzo0MDoyMw==</item><item key=\"Exif_IFD_Pointer\" base64=\"1\">MTY4</item></array><array name=\"exif\"><item key=\"ColorSpace\" base64=\"1\">MQ==</item><item key=\"ExifImageWidth\" base64=\"1\">Nzcw</item><item key=\"ExifImageLength\" base64=\"1\">Mjgx</item></array></information></ezimage>\n','ezimage',286,'eng-GB',2,0,'',1),(0,187,68,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>','ezxmltext',287,'eng-GB',2,0,'',1),(0,188,68,0,1,'','ezgmaplocation',288,'eng-GB',2,0,'Castor, Italy',1),(0,189,68,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezauthor><authors><author id=\"0\" name=\"Administrator User\" email=\"nospam@ez.no\"/></authors></ezauthor>\n','ezauthor',289,'eng-GB',2,0,'',1),(0,190,68,0,0,'','ezdatetime',290,'eng-GB',2,0,'',1),(0,191,68,0,0,'','ezsrrating',291,'eng-GB',2,0,'',1),(0,192,68,0,NULL,'','ezkeyword',292,'eng-GB',2,0,'',1),(0,181,69,0,NULL,'Create','ezstring',293,'eng-GB',2,0,'create',1),(0,182,69,0,NULL,'','ezstring',294,'eng-GB',2,0,'',1),(0,183,69,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Increasing the productivity of your content infrastructure, eZ Publish Enterprise provides you with powerful tools to create, automate and collaborate on content...</paragraph></section>','ezxmltext',295,'eng-GB',2,0,'',1),(0,184,69,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Dealing with hundreds of editors, having millions of content contributions from different sources and managing information with dozens of audiences can get complex. You get a single tool to create content whatever the content type is. From very simple and unstructured to highly structured content with complex metadata and rich media. eZ Publish Enterprise enables your non-technical contributors to manage complex content infrastructures and to collaborate with co-workers to get tasks done quickly.</paragraph></section>','ezxmltext',296,'eng-GB',2,0,'',1),(0,185,69,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:x