thor><authors><author id=\"0\" name=\"Administrator User\" email=\"nospam@ez.no\"/></authors></ezauthor>\n','ezauthor',301,'eng-GB',2,0,'',1),(0,190,69,0,0,'','ezdatetime',302,'eng-GB',2,0,'',1),(0,191,69,0,0,'','ezsrrating',303,'eng-GB',2,0,'',1),(0,192,69,0,NULL,'','ezkeyword',304,'eng-GB',2,0,'',1),(0,181,70,0,NULL,'Optimize','ezstring',305,'eng-GB',2,0,'optimize',1),(0,182,70,0,NULL,'','ezstring',306,'eng-GB',2,0,'',1),(0,183,70,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Its about the right content at the right time and in the right format!</paragraph></section>','ezxmltext',307,'eng-GB',2,0,'',1),(0,184,70,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>eZ Publish Enterprise offers an entire set of capabilities including search, analytics, personalized recommendations as well as automated and integrated testing functionality (e.g. A/B, Multivariate, etc.). Efficient search starts with enabling editors and letting them search for existing content to reuse and re-purpose. You can analyze the user behavior, create a compelling content strategy and provide automated scenarios based on the users\' behavior.</paragraph></section>','ezxmltext',308,'eng-GB',2,0,'',1),(0,185,70,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>','ezxmltext',309,'eng-GB',2,0,'',1),(0,186,70,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Optimize.jpg\" suffix=\"jpg\" basename=\"Optimize\" dirpath=\"var/ezdemo_site/storage/images/getting-started/selected-featur