ng-GB',2,0,'getting started with ez publish platform',1),(0,182,71,0,NULL,'','ezstring',318,'eng-GB',2,0,'',1),(0,183,71,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><line xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Welcome to eZ Publish Platform 5.4, the Castor release.</line><line xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">This release brings several new features and general improvements on the foundations introduced in eZ Publish Platform 5</line></paragraph></section>','ezxmltext',319,'eng-GB',2,0,'',1),(0,184,71,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><section><header>Key Selected New Features in eZ Publish 5.4</header><paragraph>Our objective is to provide you the most compelling Multichannel Web and Customer Experience Platform. With the eZ Publish 5 architecture we encompass a thoroughly revamped platform, which facilitates better user experiences, increases productivity, and enables your digital business model sustainably. Underlying and enabling these ambitious goals is a completely new but thoroughly backward compatible product architecture, along with a host of user interface (UI) enhancements. New in 5.4:</paragraph><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\"><ul><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Native IO support</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Faster multilingual and multisite search API</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Native support for legacy DFS cluster</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">New image alias system</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">URL decorators</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Premium content wall</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Improved HTTP cache system</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Simplified configuration</paragraph></li></ul></paragraph><paragraph>For further information visit <link url_id=\"8\">www.ez.no,</link> the documentation: <link url_id=\"25\">doc.ez.no</link> and the <link url_id=\"24\">share.ez.no</link> community.</paragraph></section></section>','ezxmltext',320,'eng-GB',2,0,'',1),(0,185,71,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><section><header>Key new features you don\'t want to miss</header><paragraph>eZ Publish Platform 5.4 provides a range of core improvements to the eZ platform that will be core to eZ Platform in the future. You clearly want to know about the benefits for your eZ Publish project...</paragraph></section></section>','ezxmltext',321,'eng-GB',2,0,'',1),(0,186,71,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Getting-Started-with-eZ-Publish-Platform.jpg\" suffix=\"jpg\" basename=\"Getting-Started-with-eZ-Publish-Platform\" dirpath=\"var/ezdemo_site/storage/images/getting-started/selected-features/getting-started-with-ez-publish-platform/322-1-eng-GB\" url=\"var/ezdemo_site/storage/images/getting-started/selected-features/getting-started-with-ez-publish-platform/322-1-eng-GB/Getting-Started-with-eZ-Publish-Platform.jpg\" original_filename=\"1f96ad5f.jpg\" mime_type=\"image/jpeg\" width=\"770\" height=\"378\" alternative_text=\"\"