,'ezxmltext',338,'eng-GB',2,0,'',1),(0,214,74,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Made of lightweight hard shell plastic, this case protects the back and sides of your iPhone 4 without adding bulk. Made with a matte finish, your designs, photos, and text will look great displayed on this one of a kind case.</paragraph><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\"><ul><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Designed for Apples iPhone 4.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Hard shell plastic case with matte finish.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Access to all ports, controls &amp; sensors.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Customize with photos, artwork and text.</paragraph></li></ul></paragraph></section>','ezxmltext',339,'eng-GB',2,0,'',1),(0,215,74,35.95,NULL,'','ezprice',340,'eng-GB',2,3595,'',1),(0,216,74,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"eZ-Publish-Community-iPhone-4-Case.jpg\" suffix=\"jpg\" basename=\"eZ-Publish-Community-iPhone-4-Case\" dirpath=\"var/ezdemo_site/storage/images/shopping/products/ez-publish-community-iphone-4-case/341-1-eng-GB\" url=\"var/ezdemo_site/storage/images/shopping/products/ez-publish-community-iphone-4-case/341-1-eng-GB/eZ-Publish-Community-iPhone-4-Case.jpg\" original_filename=\"94bbf784.jpg\" mime_type=\"image/jpeg\" width=\"512\" height=\"512\" alternative_text=\"Case Savvy iPhone 4 Matte Finish Case\" alias_key=\"1293033771\" timestamp=\"1423236426\"><original attribute_id=\"341\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"512\