045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Contoured perfectly to fit the Galaxy S3, this case features a hard shell plastic exterior and shock absorbing liner to protect your device from daily wear and tear. Sleek and lightweight, this case is the perfect way to share your custom style with the world.</paragraph><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\"><ul><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Impact resistant &amp; lightweight hard plastic case with rubber lined interior.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Designed for the Samsung Galaxy S3 (AT&amp;T, Verizon, T-Mobile, and Sprint models).</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Printed in the USA.</paragraph></li></ul></paragraph></section>','ezxmltext',349,'eng-GB',2,0,'',1),(0,215,75,44.95,NULL,'','ezprice',350,'eng-GB',2,4495,'',1),(0,216,75,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"eZ-Publish-Samsung-Galaxy-SIII-Case.jpg\" suffix=\"jpg\" basename=\"eZ-Publish-Samsung-Galaxy-SIII-Case\" dirpath=\"var/ezdemo_site/storage/images/shopping/products/ez-publish-samsung-galaxy-siii-case/351-1-eng-GB\" url=\"var/ezdemo_site/storage/images/shopping/products/ez-publish-samsung-galaxy-siii-case/351-1-eng-GB/eZ-Publish-Samsung-Galaxy-SIII-Case.jpg\" original_filename=\"d1452126.jpg\" mime_type=\"image/jpeg\" width=\"512\" height=\"512\" alternative_text=\"Case-Mate Samsung Galaxy S3 Vibe Case\" alias_key=\"1293033771\" timestamp=\"1423236426\"><original attribute_id=\"351\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"512\" Width=\"512\" IsColor=\"1\"/></ezimage>\n','ezimage',351,'eng-GB',2,0,''