.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>','ezxmltext',379,'eng-GB',3,0,'',1),(380,158,78,0,1,'','ezboolean',380,'eng-GB',3,1,'',1),(0,181,79,0,NULL,'Support & Maintenance','ezstring',381,'eng-GB',2,0,'support & maintenance',1),(0,182,79,0,NULL,'','ezstring',382,'eng-GB',2,0,'',1),(0,183,79,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Product Support is the core service of the eZ Publish Enterprise subscription, available to all our customers, with differing initial response times depending on the subscription service level.Subscribing to eZ Publish Enterprise gives you the option of requesting assistance from our product support team.</paragraph></section>','ezxmltext',383,'eng-GB',2,0,'',1),(0,184,79,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><section><header>Dedicated, Responsive and Efficient</header><paragraph>Product Support is the core service of the eZ Publish Enterprise subscription, available to all our customers, with differing initial response times depending on the subscription service level.</paragraph><section><header>Unlimited Product Support</header><paragraph>In addition to the available documentation and books, Enterprise subscribers have access to a highly professional support service which provides 3 tiers of support, escalation processes and both online and phone access.Our highly qualified, experienced product support teams are dedicated to the success of our customers. They ensure that your projects are successful and that you are totally satisfied with eZ. eZ is dedicated to helping and supporting both clients and partners. This is the core service of eZ\'s Enterprise Open Source Business model.</paragraph></section><section><header>Access to extended solution support</header><paragraph>In addition to maintenance, you may want assistance from our professional services team to help manage your platform or assist with eZ Publish-based application development. With eZ Publish Enterprise, you are free to include extended services from our professional services staff. They are on-hand to help you implement and run your platform. Services differ depending on your region. They can include solution support tickets, regular audits, technical key accounting or training services.</paragraph><paragraph>No single solution is right for everyone, and just as one size does not fit all, you will discuss extended solution support with our sales engineer to define the specific package that fits your needs!</paragraph><paragraph>In the event that you need a one-time intervention, you have the flexibility to order specific professional services in addition to your service subscription at a moments notice.</paragraph></section></section><section><header>Keep Your Platform Secure and Up-to-Date</header><paragraph>Subscribing to eZ Publish Enterprise gives you the option of requesting assistance from our product support team.</paragraph><section><header>eZ Publish Enterprise maintenance</header><paragraph>Subscribing to eZ Publish Enterprise gives you the option of requesting assistance from our product support team. In addition, eZ is constantly actively maintaining and assuring the quality of our software. With an eZ Publish Enterprise subscription, your installation will benefit from our quality assurance programs, which feature service packs to fix issues identified in the software as well as improve or enhance it in a variety of ways. eZ Publish Enterprise subscription is the best option for ensuring your eZ Publish platform is stable, reliable and continuously supported by our support services.</paragraph></section><section><header>eZ Publish bug fix guarantee</header><paragraph>By subscribing to eZ Publish Enterprise, you benefit from an unique bug fix guarantee that cannot be obtained in any other way. eZ, as the maker of eZ Publish, deploys the necessary resources in order to fix the bugs you identify via the maintenance service.</paragraph><paragraph>If need be, and depending of the service level of your subscription, eZ will provide hot fixes - a rapid-response measure to workaround issues before the fix is even available in the maintenance service.</paragraph></section></section></section>','ezxmltext',384,'eng-GB',2,0,'',1),(0,185,79,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>\n','ezxmltext',385,'eng-GB',2,0,'',1),(0,186,79,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Support-Maintenance.jpg\" suffix=\"jpg\" basename=\"Support-Maintenance\" dirpath=\"var/ezdemo_site/storage/images/shopping/services/support-maintenance/386-1-eng-GB\" url=\"var/ezdemo_site/storage/images/shopping/services/support-maintenance/386-1-eng-GB/Support-Maintenance.jpg\" original_filename=\"4ff73fcb.jpg\" mime_type=\"image/jpeg\" width=\"640\" height=\"427\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236427\"><original attribute_id=\"386\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"427\" Width=\"640\" IsColor=\"1\"/></ezimage>\n','ezimage',386,'eng-GB',2,0,'',1),(0,187,79,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Photo: Martin Bekkelund, Friprogsenteret. <link xhtml:id=\"yui_3_7_3_3_1361872687650_893\" url_id=\"40\">CC Some rights reserved</link></paragraph></section>','ezxmltext',387,'eng-GB',2,0,'',1),(0,188,79,0,0,'','ezgmaplocation',388,'eng-GB',2,0,'',1),(0,189,79,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezauthor><authors><author id=\"0\" name=\"Administrator User\" email=\"admin@ezmarketingautomation.com\"/></authors></ezauthor>\n','ezauthor',389,'eng-GB',2,0,'',1),(0,190,79,0,0,'','ezdatetime',390,'eng-GB',2,0,'',1),(0,191,79,0,0,'','ezsrrating',391,'eng-GB',2,0,'',1),(0,192,79,0,NULL,'','ezkeyword',392,'eng-GB',2,0,'',1),(0,181,80,0,NULL,'Professional Services','ezstring',393,'eng-GB',2,0,'professional services',1),(0,182,80,0,NULL,'','ezstring',394,'eng-GB',2,0,'',1),(0,183,80,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>eZ offersExpert ConsultingandAuditsvia our Professional Services to help keep your eZ websites on-time, on-track and performing at peak levels. Our goal is that your implementation succeeds and that you get your message out on-time and on-budget.</paragraph></section>','ezxmltext',395,'eng-GB',2,0,'',1),(0,184,80,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>eZ offers professional services to assist partners and/or clients with unusually complex situations that require specific project assistance. The scope is determined and customized prior to the time of engagement. Work can be performed remotely or on the client premises according to project needs.</paragraph></section>','ezxmltext',396,'eng-GB',2,0,'',1),(0,185,80,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xm