New eZ Publish version released ? If you need an overview of the new features and changes of a new eZ Publish version, simply book our update training and you will learn everything about the new version. You learn the...</paragraph><paragraph><link url_id=\"44\">more </link></paragraph></section></section><section><section><header><link url_id=\"45\">Custom Training</link></header><paragraph>If you have special topics which we did not mention in the categories above? We can design a training only for you. You define your interests and we prepare special training material matching your needs. Custom traini...</paragraph><paragraph><link url_id=\"45\">more </link></paragraph></section></section><section><section><header><link url_id=\"46\">eZ Partner Training</link></header><paragraph>Participation in the eZ System Partner Program affords the ability to offer eZ training curriculum, add value to offerings, enhance training business and opens doors to the eZ\'s ecosystem of partners and customers, wh...</paragraph><paragraph><link url_id=\"46\">more </link></paragraph></section></section><section><section><header><link url_id=\"47\">Online Certification</link></header><paragraph>Most trainings are combined with the option of an online certification. eZ systems offers to perform an online exam with an automated tool.</paragraph></section></section></section>','ezxmltext',408,'eng-GB',2,0,'',1),(0,185,81,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>\n','ezxmltext',409,'eng-GB',2,0,'',1),(0,186,81,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Training-Services.jpg\" suffix=\"jpg\" basename=\"Training-Services\" dirpath=\"var/ezdemo_site/storage/images/shopping/services/training-services/410-1-eng-GB\" url=\"var/ezdem