mage=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Pretty simple:</paragraph><paragraph><embed align=\"center\" view=\"embed\" size=\"large\" custom:offset=\"0\" custom:limit=\"5\" object_id=\"96\"/></paragraph></section>\n','ezxmltext',458,'eng-GB',2,0,'',1),(0,198,89,0,1332932400,'','ezdatetime',459,'eng-GB',2,1332932400,'',1),(0,199,89,0,NULL,'','ezkeyword',460,'eng-GB',2,0,'',1),(0,254,90,0,NULL,'Gallery','ezstring',461,'eng-GB',2,0,'gallery',1),(0,255,90,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>','ezxmltext',462,'eng-GB',2,0,'',1),(0,256,90,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>','ezxmltext',463,'eng-GB',2,0,'',1),(0,257,90,0,NULL,'','ezobjectrelation',464,'eng-GB',2,0,'',1),(0,258,90,0,NULL,'','ezkeyword',465,'eng-GB',2,0,'',1),(0,196,91,0,NULL,'It\'s helping me optimizing my business','ezstring',466,'eng-GB',2,0,'it\'s helping me optimizing my business',1),(0,197,91,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Mauris hendrerit dignissim nisl, non sagittis velit aliquet ut. Ut egestas euismod tempus. Aliquam luctus ultrices interdum. Donec commodo, mi quis cursus feugiat, odio arcu tempor tortor, et sollicitudin velit nulla vitae mi. Cras feugiat interdum sem, quis vestibulum nisl interdum vel. Fusce eget nibh mauris. Nulla et purus sed urna pharetra egestas eu sed dui. Nulla sollicitudin eu eros sit amet porttitor.In lacus justo, cursus tincidunt quam eu, pretium pellentesque tellus. Nulla condimentum ultrices lorem, in ornare nulla imperdiet nec. Etiam facilisis vestibulum ligula condimentum interdum. Sed molestie nunc gravida nunc tristique gravida. Proin laoreet luctus enim nec interdum. Proin massa mi, rutrum et dui sit amet, consectetur elementum sem. Sed lorem massa, scelerisque in nunc eu, tempor auctor purus. Aliquam convallis enim non viverra molestie. Ut quis arcu fringilla, vehicula eros et, scelerisque turpis. Donec at ante eu mauris sagittis posuere. Suspendisse sit amet risus dolor. Donec posuere massa eget consequat malesuada. Nunc eget feugiat massa.</paragraph></section>','ezxmltext',467,'eng-GB',2,0,'',1),(0,198,91,0,1358956920,'','ezdatetime',468,'eng-GB',2,1358956920,'',1),(0,199,91,0,NULL,'','ezkeyword',469,'eng-GB',2,0,'',1),(0,200,92,0,NULL,'Discover eZ Publish 5','ezstring',470,'eng-GB',2,0,'discover ez publish 5',1),(0,201,92,0,1045487555,'<?xml version=\"1.0\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong><embed align=\"right\" view=\"embed\" size=\"medium\" custom:offset=\"0\" custom:limit=\"5\" object_id=\"102\"/>Mont Castor</strong>&#xA0;Castor (Italian: Castore) is a mountain in the Pennine Alps on the border between Valais, Switzerland and the Aosta Valley in Italy. It is the higher of a pair of twin peaks (Zwillinge), the other being Pollux, named after the Gemini twins of Roman mythology. Castor\'s peak is at an elevation of 4,228 m (13,871 ft), and it lies between Breithorn and Monte Rosa. It is separated from Pollux by a pass at 3,845 m (12,615 ft), named Passo di Verra in Italian and Zwillingsjoch in German.</paragraph><section><section><header>White Papers</header><paragraph>Download our white paper if you want to quickly discover eZ Publish 5.</paragraph><paragraph>This white paper contains</paragraph><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\"><ul><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\"><strong>A detailed presentation of eZ Publish 5 for Marketers and Editors.</strong></paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\"><strong>An introduction to the eZ Publish 5 technical architecture.</strong></paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\"><strong>A clear summary of the value of using such a digital user experience management platform.</strong></paragraph></li></ul></paragraph><paragraph>Don\'t hesitate, leave us your contact information and download this paper to get all the benefits of eZ Publish 5.</paragraph></section></section></section>\n','ezxmltext',471,'eng-GB',2,0,'',1),(0,202,92,0,93,'681116da12d3fed558704658248067da','ezobjectrelation',472,'eng-GB',2,93,'',1),(0,203,92,0,NULL,'','ezstring',473,'eng-GB',2,0,'',1),(0,204,92,0,NULL,'','ezstring',474,'eng-GB',2,0,'',1),(0,205,92,0,NULL,'','ezemail',475,'eng-GB',2,0,'',1),(0,206,92,0,NULL,'','ezcountry',476,'eng-GB',2,0,'',1),(0,207,92,0,NULL,'','eztext',477,'eng-GB',2,0,'',1),(0,208,92,0,NULL,'Get your copy!','ezstring',478,'eng-GB',2,0,'get your copy!',1),(0,181,93,0,NULL,'Download your White Paper here','ezstring',479,'eng-GB',2,0,'download your white paper here',1),(0,182,93,0,NULL,'','ezstring',480,'eng-GB',2,0,'',1),(0,183,93,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Thanks for your interest, please download your copy of the white paper below.</paragraph></section>','ezxmltext',481,'eng-GB',2,0,'',1),(0,184,93,0,1045487555,'<?xml version=\"1.0\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Beyond Content Management, managing &#x201C;Digital Experiences&#x201D;, takes much more than technology; it is a strategy that focuses on the operations and processes of a business around the needs of the individual customer. Today leading organizations are increasingly focusing on building great experiences but realize it is a complex enterprise, involving strategy, integration of technology, orchestrating business models, brand management and CEO commitment.&#xA0;</paragraph><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\"><embed view=\"embed\" size=\"medium\" custom:offset=\"0\" custom:limit=\"5\" object_id=\"95\"/></paragraph></section>\n','ezxmltext',482,'eng-GB',2,0,'',1),(0,185,93,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>\n','ezxmltext',483,'eng-GB',2,0,'',1),(0,186,93,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"\" filename=\"\" suffix=\"\" basename=\"\" dirpath=\"\" url=\"\" original_filename=\"\" mime_type=\"\" width=\"\" height=\"\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236430\"><original attribute_id=\"484\" attribute_version=\"1\" attribute_language=\"eng-GB\"/></ezimage>\n','ezimage',484,'eng-GB',2,0,'',1),(0,187,93,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>','ezxmltext',485,'eng-GB',2,0,'',1),(0,188,93,0,0,'','ezgmaplocation',486,'eng-GB',2,0,'',1),(0,189,93,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezauthor><authors><author id=\"0\" name=\"Administrator User\" email=\"nospam@ez.no\"/></authors></ezauth