 visited by sightseers and climbers. It is one of Japan\'s \"Three Holy Mountains\"along withMount TateandMount Haku; it is aSpecial Place of Scenic Beauty, aHistoric Site, and was added to theWorld Heritage Listas a Cultural Site on June 22nd, 2013.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"54\">Mount Fuji</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',568,'eng-GB',2,0,'',1),(0,289,109,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Mount-Fuji.jpg\" suffix=\"jpg\" basename=\"Mount-Fuji\" dirpath=\"var/ezdemo_site/storage/images/ez-mountains/mount-fuji/569-1-eng-GB\" url=\"var/ezdemo_site/storage/images/ez-mountains/mount-fuji/569-1-eng-GB/Mount-Fuji.jpg\" original_filename=\"d5c11bd1.jpg\" mime_type=\"image/jpeg\" width=\"770\" height=\"578\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236432\"><original attribute_id=\"569\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"578\" Width=\"770\" IsColor=\"1\" ByteOrderMotorola=\"1\" ApertureFNumber=\"f/2.8\" Thumbnail.FileType=\"2\" Thumbnail.MimeType=\"image/jpeg\"><serialized name=\"ifd0\" data=\"a:15:{s:10:&quot;ImageWidth&quot;;i:2560;s:11:&quot;ImageLength&quot;;i:1920;s:13:&quot;BitsPerSample&quot;;a:3:{i:0;i:8;i:1;i:8;i:2;i:8;}s:25:&quot;PhotometricInterpretation&quot;;i:2;s:4:&quot;Make&quot;;s:5:&quot;CASIO&quot;;s:5:&quot;Model&quot;;s:9:&quot;QV-5700  &quot;;s:11:&quot;Orientation&quot;;i:1;s:15:&quot;SamplesPerPixel&quot;;i:3;s:11:&quot;XResolution&quot;;s:4:&quot;72/1&quot;;s:11:&quot;YResolution&quot;;s:4:&quot;72/1&quot;;s:14:&quot;ResolutionUnit&quot;;i:2;s:8:&quot;Software&quot;;s:31:&quot;Adobe Photoshop CS6 (Macintosh)&quot;;s:8:&quot;DateTime&quot;;s:19:&quot;2013:02:05 19:00:18&quot