-GB',2,0,'',1),(0,290,109,0,1,'','ezgmaplocation',570,'eng-GB',2,0,'mount fuji',1),(0,291,109,0,NULL,'','ezkeyword',571,'eng-GB',2,0,'',1),(0,292,109,0,0,'','ezsrrating',572,'eng-GB',2,0,'',1),(0,287,110,0,NULL,'Mount Matterhorn','ezstring',573,'eng-GB',2,0,'mount matterhorn',1),(0,288,110,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>The<strong>Matterhorn</strong>(German),<strong>Monte Cervino</strong>(Italian) or<strong>Mont Cervin</strong>(French), is a mountain in thePennine Alpson the border betweenSwitzerlandandItaly. Its summit is 4,478 metres (14,692ft) high, making it one of the highest peaks in theAlps.The four steep faces, rising above the surrounding glaciers, face the four compass points. The mountain overlooks the town ofZermattin the canton ofValaisto the north-east andBreuil-Cerviniain theAosta Valleyto the south.Theodul Pass, located at the eastern base of the peak, is the lowest passage between its north and south side.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article<link target=\"_blank\" url_id=\"56\">Matterhorn</link>, which is released under the<link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',574,'eng-GB',2,0,'',1),(0,289,110,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Mount-Matterhorn.jpg\" suffix=\"jpg\" basename=\"Mount-Matterhorn\" dirpath=\"var/ezdemo_site/storage/images/ez-mountains/mount-matterhorn/575-1-eng-GB\" url=\"var/ezdemo_site/storage/images/ez-mountains/mount-matterhorn/575-1-eng-GB/Mount-Matterhorn.jpg\" original_filename=\"7df85099.jpg\" mime_type=\"image/jpeg\" width=\"770\" height=\"578\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236433\"><original attribute_id=\"575\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"578\" Width=\"770\" IsColor=\"1\" ByteOrderMotorola=\"0\"/></ezimage>\n','ezimage',575,'eng-GB',2,0,'',1),(0,290,110,0,1,'','ezgmaplocation',576,'eng-GB',2,0,' Mount Matterhorn',1),(0,291,110,0,NULL,'','ezkeyword',577,'eng-GB',2,0,'',1),(0,292,110,0,0,'','ezsrrating',578,'eng-GB',2,0,'',1),(0,287,111,0,NULL,'Mount Annapurna','ezstring',579,'eng-GB',2,0,'mount annapurna',1),(0,288,111,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Annapurna</strong>(Sanskrit,Nepali,Nepal Bhasa: ) is a section of theHimalayasin north-centralNepalthat includes 8,091m (26,545ft) Annapurna I, thirteen additional peaks over 7,000 m (22,970ft) and 16 more over 6,000 m (19,690ft).This section is a 55km-long (34mi-long)massifbounded by theKali Gandaki Gorgeon the west, theMarshyangdiRiver on the north and east, andPokhara Valleyon the south. Annapurna I is tenth among Earth\'s fourteen<emphasize>eight-thousanders</emphasize>. 8167 metreDhaulagiriI rises 34km to the west across theKali Gandaki Gorge, considered Earth\'s deepest canyon.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article<link target=\"_blank\" url_id=\"57\">Annapurna</link>, which is released under the<link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',580,'eng-GB',2,0,'',1),(0,289,111,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Mount-Annapurna.jpg\" suffix=\"jpg\" basename=\"Mount-Annapurna\" dirpath=\"var/ezdemo_site/storage/images/ez-mountains/mount-annapurna/581-1-eng-GB\" url=\"var/ezdemo_site/storage/images/ez-mountains/mount-annapurna/581-1-eng-GB/Mount-Annapurna.jpg\" original_filename=\"553bfea2.jpg\" mime_type=\"image/jpeg\" width=\"770\" height=\"578\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236433\"><original attribute_id=\"581\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"578\" Width=\"770\" IsColor=\"1\"/></ezimage>\n','ezimage',581,'eng-GB',2,0,'',1),(0,290,111,0,1,'','ezgmaplocation',582,'eng-GB',2,0,'mount annapurna',1),(0,291,111,0,NULL,'','ezkeyword',583,'eng-GB',2,0,'',1),(0,292,111,0,0,'','ezsrrating',584,'eng-GB',2,0,'',1),(0,287,112,0,NULL,'Mount Etna','ezstring',585,'eng-GB',2,0,'mount etna',1),(0,288,112,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Mount Etna</strong>(Latin:<emphasize>Aetna</emphasize>, Sicilian:<emphasize>Mungibeddu</emphasize>or<emphasize>\'a Muntagna</emphasize>) is an activestratovolcanoon the east coast ofSicily,Italy, close toMessinaandCatania. It lies above the convergent plate margin between theAfrican Plateand theEurasian Plate. It is the tallest active volcano on theEuropeancontinent, currently 3,329m (10,922ft) high, though this varies with summit eruptions. It is the highest mountain in Italy south of theAlps. Etna covers an area of 1,190km<custom name=\"sup\">2</custom>(459sqmi) with a basal circumference of 140km. This makes it by far the largest of the threeactive volcanoes in Italy, being about two and a half times the height of the next largest,Mount Vesuvius. OnlyMount TeideinTenerifesurpasses it in the whole of the EuropeanNorth-African region.In Greek Mythology, the deadly monsterTyphonwas trapped under this mountain byZeus, the god of the sky and thunder and king of gods, and the forges ofHephaestuswere said to also be located underneath it.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article<link target=\"_blank\" url_id=\"58\">Mount Etna</link>, which is released under the<link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',586,'eng-GB',2,0,'',1),(0,289,112,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Mount-Etna.jpg\" suffix=\"jpg\" basename=\"Mount-Etna\" dirpath=\"var/ezdemo_site/storage/images/ez-mountains/mount-etna/587-1-eng-GB\" url=\"var/ezdemo_site/storage/images/ez-mountains/mount-etna/587-1-eng-GB/Mount-Etna.jpg\" original_filename=\"f5aab896.jpg\" mime_type=\"image/jpeg\" width=\"770\" height=\"578\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236433\"><original attribute_id=\"587\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"578\" Width=\"770\" IsColor=\"1\" ByteOrderMotorola=\"0\" CCDWidth=\"7mm\" ExposureTime=\"0.002 s (1/446)\" ApertureFNumber=\"f/6.3\" Copyright=\"    \"><array name=\"ifd0\"><item key=\"Make\" base64=\"1\">RlVKSUZJTE0=</item><item key=\"Model\" base64=\"1\">RmluZVBpeDY5MDBaT09N</item><item key=\"Software\" base64=\"1\">RGlnaXRhbCBDYW1lcmEgRmluZVBpeDY5MDBaT09NIFZlcjEuMDA=</item><item key=\"DateTime\" base64=\"1\">MjAwMzoxMjozMSAwOTo0NDo0Nw==</item><item key=\"YCbCrPositioning\" base64=\"1\">Mg==</item><item key=\"Copyright\" base64=\"1\">ICAgIA==</item><item key=\"Exif_IFD_Pointer\" base64=\"1\">MTkw</item></array><array name=\"exif\"><item key=\"FNumber\" base64=\"1\">NjMwLzEwMA==</item><item key=\"ExposureProgram\" base64=\"1\">Mg==</item><item key=\"ISOSpeedRatings\" base64=\"1\">MTAw</item><item key=\"ExifVersion\" base64=\"1\">MDIxMA==</item><item key=\"DateTimeOriginal\" base64=\"1\">MjAwMzoxMjozMSAwOTo0NDo0Nw==</item><item key=\"DateTimeDigitized\" base64=\"1\">MjAwMzoxMjozMSAwOTo0NDo0Nw==</item><item key=\"ComponentsConfiguration\" base64=\"1\">AQIDAA==</item><item key=\"CompressedBitsPerPixel\" base64=\"1\">MTUvMTA=</item><