><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article<link target=\"_blank\" url_id=\"59\">Mount Kilimanjaro</link>, which is released under the<link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',592,'eng-GB',2,0,'',1),(0,289,113,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Mount-Kilimanjaro.jpg\" suffix=\"jpg\" basename=\"Mount-Kilimanjaro\" dirpath=\"var/ezdemo_site/storage/images/ez-mountains/mount-kilimanjaro/593-1-eng-GB\" url=\"var/ezdemo_site/storage/images/ez-mountains/mount-kilimanjaro/593-1-eng-GB/Mount-Kilimanjaro.jpg\" original_filename=\"944650b0.jpg\" mime_type=\"image/jpeg\" width=\"770\" height=\"578\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236434\"><original attribute_id=\"593\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"578\" Width=\"770\" IsColor=\"1\" ByteOrderMotorola=\"0\"/></ezimage>\n','ezimage',593,'eng-GB',2,0,'',1),(0,290,113,0,1,'','ezgmaplocation',594,'eng-GB',2,0,'mount kilimanjaro',1),(0,291,113,0,NULL,'','ezkeyword',595,'eng-GB',2,0,'',1),(0,292,113,0,0,'','ezsrrating',596,'eng-GB',2,0,'',1),(0,287,114,0,NULL,'Mount Stadda','ezstring',597,'eng-GB',2,0,'mount stadda',1),(0,288,114,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Stadda </strong>(inLule Sami:<emphasize>Stdda</emphasize>) is a mountain in the municipality ofTysfjordinNordlandcounty,Norway. It is located about 15 kilometres (9mi) northeast of the village ofKjpsvik. The mountain has very smooth sides reaching all the way to thefjord. Stetind has anobelisk-shape which gives it a very distinct look. In 2002 it was voted to be the \"National Mountain\" of Norway by listeners ofNRK.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article<link target=\"_blank\" url_id=\"60\">Mount Stetind</link>, which is released under the<link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',598,'eng-GB',2,0,'',1),(0,289,114,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Mount-Stadda.jpg\" suffix=\"jpg\" basename=\"Mount-Stadda\" dirpath=\"var/ezdemo_site/storage/images/ez-mountains/mount-stadda/599-1-eng-GB\" url=\"var/ezdemo_site/storage/images/ez-mountains/mount-stadda/599-1-eng-GB/Mount-Stadda.jpg\" original_filename=\"4418140f.jpg\" mime_type=\"image/jpeg\" width=\"770\" height=\"578\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236434\"><original attribute_id=\"599\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"578\" Width=\"770\" IsColor=\"1\" ByteOrderMotorola=\"1\" ApertureFNumber=\"f/2.8\" Thumbnail.FileType=\"2\" Thumbnail.MimeType=\"image/jpeg\"><array name=\"ifd0\"><item key=\"Make\" base64=\"1\">Q0FTSU8=</item><item key=\"Model\" base64=\"1\">UVYtNTcwMCAg</item><item key=\"Orientation\" base64=\"1\">MQ==</item><item key=\"XResolution\" base64=\"1\">NzIvMQ==</item><item key=\"YResolution\" base64=\"1\">NzIvMQ==</item><item key=\"ResolutionUnit\" base64=\"1\">Mg==</item><item key=\"Software\" base64=\"1\">VmVyMS4wMCAgICAgICAgICAgICAgICA=</item><item key=\"DateTime\" base64=\"1\">MjAwMzowNzoxMSAyMDoxNTo0NQ==</item><item key=\"YCbCrPositioning\" base64=\"1\">MQ==</item><item key=\"Exif_IFD_Pointer\" base64=\"1\">MjYy</item><item key=\"UndefinedTag:0xC4A5\" base64=\"1\">UHJpbnRJTQAwMjUwAAAABAABABYAFgACAQAAAAEABQAAAAEBAgAAAA==</item></array><array name=\"exif\"><item key=\"ExposureTime\" base64=\"1\">MTYwNC8xMDAwMDAw</item><item key=\"FNumber\" base64=\"1\">MjgvMTA=</item><item key=\"ExposureProgram\" base64=\"1\">