spaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Aconcagua</strong>(Spanish pronunciation:[akokawa]) is thehighest mountainin theWesternandSouthern Hemispheresat 6,960.8 metres (22,837ft).It is located in theAndesmountain range, in theprovinceofMendoza,Argentina, and lies 112 kilometres (70mi) northwest of its capital, the city of Mendoza. The summit is also located about 5 kilometres from San Juan Province and 15 kilometres from the international border withChile. Aconcagua is the highest peak in both theWesternandSouthern Hemispheres. It is one of theSeven Summits.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article<link target=\"_blank\" url_id=\"61\">Aconcagua</link>, which is released under the<link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',604,'eng-GB',2,0,'',1),(0,289,115,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Mount-Aconcagua.jpg\" suffix=\"jpg\" basename=\"Mount-Aconcagua\" dirpath=\"var/ezdemo_site/storage/images/ez-mountains/mount-aconcagua/605-1-eng-GB\" url=\"var/ezdemo_site/storage/images/ez-mountains/mount-aconcagua/605-1-eng-GB/Mount-Aconcagua.jpg\" original_filename=\"08cbe9b8.jpg\" mime_type=\"image/jpeg\" width=\"770\" height=\"578\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236434\"><original attribute_id=\"605\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"578\" Width=\"770\" IsColor=\"1\"/></ezimage>\n','ezimage',605,'eng-GB',2,0,'',1),(0,290,115,0,1,'','ezgmaplocation',606,'eng-GB',2,0,'aconcagua',1),(0,291,115,0,NULL,'','ezkeyword',607,'eng-GB',2,0,'',1),(0,292,115,0,0,'','ezsrrating',608,'eng-GB',2,0,'',1),(0,287,116,0,NULL,'Mount Ventoux','ezstring',609,'eng-GB',2,0,'mount ventoux',1),(0,288,116,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Mont Ventoux</strong>(<emphasize>Ventor</emphasize>in Provenal) is a mountain in theProvenceregion of southernFrance, located some 20km northeast ofCarpentras,Vaucluse. On the north side, the mountain borders theDrme<emphasize>dpartement</emphasize>. It is the largest mountain in the region and has been nicknamed the \"Beast of Provence\",the \"Giant of Provence\",or \"The Bald Mountain\".It has gained fame through its use in theTour de Francecycling race.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"62\">Mount Ventoux</link>, which is released under the<link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',610,'eng-GB',2,0,'',1),(0,289,116,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Mount-Ventoux.jpg\" suffix=\"jpg\" basename=\"Mount-Ventoux\" dirpath=\"var/ezdemo_site/storage/images/ez-mountains/mount-ventoux/611-1-eng-GB\" url=\"var/ezdemo_site/storage/images/ez-mountains/mount-ventoux/611-1-eng-GB/Mount-Ventoux.jpg\" original_filename=\"f2744337.jpg\" mime_type=\"image/jpeg\" width=\"770\" height=\"578\" alternative_text=\"\" alias_key=\"1293033771\" timestamp=\"1423236434\"><original attribute_id=\"611\" attribute_version=\"1\" attribute_language=\"eng-GB\"/><information Height=\"578\" Width=\"770\" IsColor=\"1\"/></ezimage>\n','ezimage',611,'eng-GB',2,0,'',1),(0,290,116,0,1,'','ezgmaplocation',612,'eng-GB',2,0,'mont ventoux',1),(0,291,116,0,NULL,'','ezkeyword',613,'eng-GB',2,0,'',1),(0,292,116,0,0,'','ezsrrating',614,'eng-GB',2,0,'',1),(0,287,117,0,NULL,'Mount Castor','ezstring',615,'eng-GB',2,0,'mount castor',1),(0,288,117,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Castor</strong>(Italian:<emphasize>Castore</emphasize>) is a mountain in thePennine Alpson the border betweenValais,Switzerlandand theAosta ValleyinItaly. It is the higher of a pair of twin peaks (Zwillinge), the other beingPollux, named after theGemini twinsofRoman mythology. Castor\'s peak is at an elevation of 4,228m (13,871ft), and it lies betweenBreithornandMonte Rosa. It is separated from Pollux by a pass at 3,845m (12,615ft), named<emphasize>Passo di Verra</emphasize>in Italian and<emphasize>Zwillingsjoch</emphasize>in German.Ascents are usually made from thealpine hut<emphasize>Capanna Quintino Sella</emphasize>on the Italian side, by means of the Felikjoch and the long and narrow southeast ridge. From the Swiss side, ascents start fromKlein Matterhornand go by way of the Italian Mezzalama glacier and the mountain\'s west flank. The first ascent was made on August 23, 1861.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article<link url_id=\"63\">Mount Castor</link>, which is released under the<link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>. <link anchor_name=\"mediaviewer/File:Castore_per_la_cresta_sudorientale.JPG\" url_id=\"64\">Photo</link>:\"Castore per la cresta sudorientale\" by Franco56 - fotografia personale. Licensed under Creative Commons Attribution-Share Alike 3.0 via Wikimedia Commons.</custom></paragraph></section>','ezxmltext',616,'eng-GB',2,0,'',1),(0,289,117,0,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<ezimage serial_number=\"1\" is_valid=\"1\" filename=\"Mount-Castor.jpg\" suffix=\"jpg\" basename=\"Mount-Castor\" dirpath=\"var/ezdemo_site/storage/images/ez-mountains/mount-castor/617-1-eng-GB\" url=\"var/ezdem